Dmitry Zaytsev:
QIWI, создатель самого узнаваемого электронного кошелька в России и странах СНГ и генератор успешных финтех проектов, приглашает на работу Программиста больших данных/ Data engineer.

Сотруднику предстоит решать следующие задачи:

Создание новых и поддержка существующих ETL-инструментов;
Разработка новых ETL процессов, оформление в Apache Airflow;
Решение data mining задач;
Подготовка данных для ML-моделирования;
Документирование произведенных изменений.
Мы ждем от кандидата:

Хорошее знание и опыт работы с Python (в том числе библиотеки Pandas), Apache Spark, SQL;

Понимание реляционных баз данных;

Опыт оптимизации SQL запросов;

Не обязательно, но будет плюсом опыт работы с большими данными и опыт работы с Java, Scala, Airflow, работа с Linux, docker;

Аналитическое мышление, умение доводить задачи до логического завершения и понимание приоритизации задач.

Условия:

Работа в Компании-лидере рынка платежных систем;
Работа в команде с лучшими профессионалами над сложными и интересными задачами;
Возможность профессионального роста;
Оформление по ТК РФ, конкурентоспособная заработная плата, премии по результатам работы;
Расширенный социальный пакет: компенсация питания, ДМС, корпоративный спорт для желающих - волейбол, баскетбол, футбол, беговой клуб и йога;
Офис в 10 минутах ходьбы от м. Чертановская
от 150000
